["To port over webmaps you made in ArcGIS Online Mapviewer to Mapbox GL JS library using code, you can use the ArcGIS API for JavaScript. Here are the general steps:

1. Export the webmap from ArcGIS Online as a JSON file.
2. Use the ArcGIS API for JavaScript to load the webmap.
3. Convert the webmap layers to Mapbox GL JS layers.
4. Create a Mapbox GL JS map and add the converted layers to the map.

Here is some sample code that demonstrates these steps:

```
// Load the ArcGIS API for JavaScript
require([
  "esri/portal/Portal",
  "esri/WebMap",
  "esri/views/MapView"
], function(Portal, WebMap, MapView) {

  // Load the webmap as a JSON file
  var webmapUrl = "https://www.arcgis.com/sharing/rest/content/items/{webmap-id}/data";
  $.getJSON(webmapUrl, function(webmapJSON) {

    // Create a new webmap object using the JSON data
    var webmap = new WebMap({
      portalItem: {
        id: webmapJSON.itemId
      }
    });

    // Load the webmap layers
    webmap.load().then(function() {

      // Convert the webmap layers to Mapbox GL JS layers
      var layers = [];
      webmap.layers.forEach(function(layer) {
        var layerSource = {
          type: "geojson",
          data: layer.url
        };
        var layerStyle = {
          "id": layer.title,
          "type": "fill",
          "source": layerSource,
          "layout": {},
          "paint": {
            "fill-color": "#888888",
            "fill-opacity": 0.5
          }
        };
        layers.push(layerStyle);
      });

      // Create a new Mapbox GL JS map
      var map = new mapboxgl.Map({
        container: "map",
        style: "mapbox://styles/mapbox/streets-v9",
        zoom: 10,
        center: [-122.4194, 37.7749]
      });

      // Add the converted layers to the map
      layers.forEach(function(layer) {
        map.addLayer(layer);
      });

    });

  });

});
```

Note that this is just a sample code and may need to be modified to fit your specific webmap."]

