["To port over webmaps from ArcGIS Online MapViewer to Mapbox GL JS, follow these steps:

1. Export your ArcGIS data as GeoJSON or another compatible format:
   a. In ArcGIS Online, open the desired webmap in MapViewer.
   b. Click on the layer you want to export.
   c. In the layer options, choose "Export Data" and select "Export to GeoJSON" or another compatible format (e.g., KML, CSV with lat/long columns).
   d. Download the exported file.

2. Set up a basic Mapbox GL JS project:
   a. Sign up for a Mapbox account (https://www.mapbox.com/) and get an access token.
   b. Create an HTML, CSS, and JS file for your project.
   c. In your HTML file, include the Mapbox GL JS library and CSS stylesheet:
   ```html
   <!DOCTYPE html>
   <html lang="en">
   <head>
       <meta charset="UTF-8">
       <title>Mapbox GL JS Map</title>
       <script src="https://api.mapbox.com/mapbox-gl-js/v2.6.1/mapbox-gl.js"></script>
       <link href="https://api.mapbox.com/mapbox-gl-js/v2.6.1/mapbox-gl.css" rel="stylesheet">
       <style>
           /* Add your custom CSS styles here */
           #map {
               width: 100%;
               height: 100vh;
           }
       </style>
   </head>
   <body>
       <div id="map"></div>
       <script src="app.js"></script>
   </body>
   </html>
   ```

3. Initialize the map in your JS file:
   ```javascript
   // app.js
   mapboxgl.accessToken = 'YOUR_MAPBOX_ACCESS_TOKEN';

   const map = new mapboxgl.Map({
       container: 'map',
       style: 'mapbox://styles/mapbox/streets-v11',
       center: [0, 0], // Set your map center coordinates
       zoom: 10 // Set your initial zoom level
   });

   map.on('load', () => {
       // Add your ArcGIS data here
   });
   ```

4. Add your exported ArcGIS data to the Mapbox GL JS map:
   a. If you exported your data as GeoJSON, you can directly add it as a source and layer:
   ```javascript
   map.on('load', () => {
       // Add the GeoJSON source
       map.addSource('arcgis-data', {
           type: 'geojson',
           data: './path/to/your/geojson-file.geojson'
       });

       // Add a layer using the source
       map.addLayer({
           id: 'arcgis-layer',
           type: 'circle', // Choose the appropriate type based on your data (e.g., 'circle', 'line', 'fill', 'symbol')
           source: 'arcgis-data',
           paint: {
               // Define your layer style properties here
           }
       });
   });
   ```
   b. If you exported your data in another format, you might need to convert it to GeoJSON first using tools like `togeojson` (https://github.com/mapbox/togeojson) for KML or `csv2geojson` (https://github.com/mapbox/csv2geojson) for CSV.

5. Customize the styling and interactivity of your map as needed using Mapbox GL JS API features and documentation (https://docs.mapbox.com/mapbox-gl-js/api/).

By following these steps, you should be able to port over your ArcGIS Online webmaps to the Mapbox GL JS library using code."]

