// exampleSchema.ts
import { IsString, IsNumber, validateOrReject } from 'class-validator';

export interface ExampleInterface {
  name: string;
  age: number;
}

export class ExampleClass implements ExampleInterface {
  @IsString()
  name: string;

  @IsNumber()
  age: number;

  constructor(name: string, age: number) {
    this.name = name;
    this.age = age;
  }

  static async fromJSON(json: string): Promise<ExampleClass> {
    const parsedJson = JSON.parse(json);
    const instance = new ExampleClass(parsedJson.name, parsedJson.age);

    // Validate the instance against the schema
    await validateOrReject(instance);

    return instance;
  }
}
```

Now you can use the `fromJSON` method to deserialize the JSON string and validate it against the schema:

```typescript
// main.ts
import { ExampleClass } from './exampleSchema';

async function main() {
  const jsonString = '{"name": "John Doe", "age": 30}';

  try {
    const exampleInstance = await ExampleClass.fromJSON(jsonString);
