// Define the ring buffer size and the maximum number of entries to print
#define RINGBUF_SIZE 10
#define MAX_ENTRIES 5

int trace_accept(struct bpf_sock_addr *addr)
{
    // Get the pid of the calling process
    uint32_t pid = bpf_get_current_pid_tgid();

    // Get the source and destination addresses for the accept system call
    struct sockaddr_storage src_addr, dest_addr;
    socklen_t src_len, dest_len = sizeof(dest_addr);
    if (addr->sa_family == AF_UNIX) {
        // For UNIX sockets, use the peer address to identify the source and destination
        if (accept(addr->sai.sa_fd, NULL, NULL) < 0) {
            return -1;
        }
        src_len = sizeof(struct sockaddr_un);
        if (getpeername(addr->sai.sa_fd, (struct sockaddr *)&src_addr, &src_len) < 0) {
            return -1;
        }
        dest_len = sizeof(struct sockaddr_un);
        if (getpeername(addr->sai.sa_fd, (struct sockaddr *)&dest_addr, &dest_len) < 0) {
            return -1;
        }
    } else {
        if (accept(addr->sa_fd, NULL, NULL) < 0) {
            return -1;
